            'description' => '{"en":"<p>Nuclear Cardiology is a specialized field of cardiology that uses radioactive substances (radiopharmaceuticals) and imaging techniques to diagnose and assess heart conditions. It includes procedures like myocardial perfusion imaging (MPI) and cardiac positron emission tomography (PET) scans to evaluate blood flow to the heart muscle, detect areas of damage, and assess overall heart function.</p>","hi":"<p>परमाणु हृदय रोग विज्ञान एक विशेषता हृदय रोग विज्ञान की शाखा है जो विकिरणीय द्रव्य (रेडियोफार्मास्युटिकल्स) और छवि प्रक्रियाओं का उपयोग करती है ताकि हृदय की स्थितियों का निदान और मूल्यांकन किया जा सके। इसमें मायोकार्डियल परफ्यूजन इमेजिंग (एमपीआई) और कार्डियक पॉजिट्रॉन इमिशन टोमोग्राफी (पीईटी) स्कैन्स जैसी प्रक्रियाएं शामिल होती हैं जो हृदय मांसपेशी को रक्त प्रवाह की मापदंडीकरण करने, क्षति के क्षेत्रों की पहचान करने और समग्र हृदय कार्यक्षमता का मूल्यांकन करने के लिए क</p>","ar":"<p>Nuclear Cardiology is a specialized field of cardiology that uses radioactive substances (radiopharmaceuticals) and imaging techniques to diagnose and assess heart conditions. It includes procedures like myocardial perfusion imaging (MPI) and cardiac positron emission tomography (PET) scans to evaluate blood flow to the heart muscle, detect areas of damage, and assess overall heart function.</p>"}',
