                'description' => '{"en":"<p>Interventional Cardiology is a branch of cardiology that uses catheter-based techniques to diagnose and treat cardiovascular diseases. It involves procedures such as angioplasty, stenting, and transcatheter valve interventions to restore blood flow and repair heart defects without the need for surgery.</p>","hi":"<p>अन्तर्वेषणीय हृदय रोग विज्ञान एक ऐसी हृदय रोग विज्ञान की शाखा है जो कैथेटर आधारित तकनीकों का उपयोग करती है ताकि हृदय रोगों का निदान और उपचार किया जा सके। इसमें एंजियोप्लास्टी, स्टेंटिंग, और ट्रांसकैथेटर वाल्व इंटरवेंशन जैसी प्रक्रियाएं शामिल होती हैं जिनके द्वारा रक्त प्रवाह को बहाल किया जाता है और हृदय के दोषों को सुधारा जाता है बिना सर्जरी की आवश्यकता के।</p>","ar":"<p>&nbsp;طب القلب التدخلي هو فرع من فروع طب القلب يستخدم تقنيات القسطرة لتشخيص وعلاج الأمراض القلبية والوعائية. يشمل الإجراءات مثل التمدد الركيزي، الأسيتنت، والتدخلات الصمامية عبر القسطرة لاستعادة تدفق الدم وإصلاح عيوب القلب دون الحاجة إلى جراحة.</p>"}',
